import React from 'react';
import RestaurantMenu from './components/RestaurantMenu';



const App = () => {
  return (
      <RestaurantMenu restaurant="Mos Burger" minOrder='10' items = {[
        {
            name: 'MOS Burger',
            price: '3.55',
            img: '/mosburger.jfif'

        },
        {
            name: 'MOS Cheeseburger',
            price: '3.85',
            img: '/cheese.jfif'
        },
        {
            name: 'Teriyaki Burger',
            price: '3.55',
            img: '/teri.jfif'
        },
        {
            name: 'Chicken Burger',
            price: '3.45',
            img: '/chx.jfif'
        }
    ]}/>
  );
};


export default App;
